import React from 'react'
import styled from 'styled-components'

export const Logocontext = React.createContext()

export const Logo = () =>
{
    return(
       <Frame>Cov-Live</Frame>
    )
}
const Frame = styled.span`
background:#706bfa;
padding:0;
margin:0;
width : 200px;
color : white;
animation : blob 5s linear infinite;
@keyframes blob
{
    0%,100%
    {
        border-radius : 64% 36% 27% 73% / 55% 58% 42% 25%;
    }
    25%
    {
        border-radius : 73% 27% 52% 65% /23% 25% 51% 13%;
    }
    50%
    {
        border-radius : 45% 12% 79% 25% / 56% 23% 45% 63%;
    }
    75%
    {
        border-radius : 73% 14% 31% 14%/ 47% 8% 2% 54%;
    }
}
`
